import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jpg';

const StartButton = styled(Button)(({ theme }) => ({
  color: '#FFFFFF',
  backgroundColor: '#FFF345',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));


export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }


  return (
    <div>
      <AppBar position='sticky' elevation={4} sx={{boxShadow:'0 3rem 0.525rem #000000'}}>
        <Toolbar>
          Eden's Garden
        </Toolbar>
      </AppBar>
      <Grid container columns={1}>
        <Grid item  sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'100%'}}>
          <Grid container column='2'>
            <Grid item sx={{width:'50%',height:'100vh',bgcolor:'#000456', textAlign:'center'}}>
              <Typography variant='subtitle1' sx={{ color:'#FFFFFF', marginTop:'5rem'}}>
              Every year, the US wastes about 40% of the food it produces.
              </Typography>
              <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
                Meanwhile, over 41 million people in the US face hunger.
              </Typography>
              <Typography variant='subtitle1' sx={{marginBottom:'5rem', color:'#FFFFFF'}}>
                At Eden's Garden, We make sure this doesn't happen
              </Typography>
              <StartButton onClick={startButtonClick} variant='contained'>Help Us</StartButton>
            </Grid>
            <Grid item>
              Hello World
            </Grid>
          </Grid>
        </Grid>
        <Grid item textAlign='center' sx={{ bgcolor: '#f32432', height: '20rem', width:'100%'}}>
          Hello World
        </Grid>
      </Grid>
    </div>
  );
}
